                <button className="text-md text-gray95 font-medium">See all</button>
            </div>
            <div>

                <div><svg width="63" height="63" viewBox="0 0 63 63" fill="none" xmlns="http://www.w3.org/2000/svg">
                    <rect width="63" height="63" fill="#D1D5DB" />
                </svg>
                </div>
                <div></div>
                <div></div>
                <div></div>

            </div>
        </div>
    )
};
